	/**
	 * 显示对话框
	 * Utils.app.showDialog(content, [title,] noCallback, okCallback); // 确定取消按钮都有
	 * Utils.app.showDialog(content, [title,] true, okCallback); // 确定取消按钮都有
	 * Utils.app.showDialog(content, [title,] true, false); // 只有取消按钮
	 * Utils.app.showDialog(content, [title,] okCallback); // 只有确定按钮
	 * Utils.app.showDialog(content, [title,]); // 只有确定按钮, 且没有回调函数
	 */
	Utils.app.showDialog = function(content, title, noCallback, okCallback) {
		var params = { title:"提示", content:"提示内容不能为空", yes_action:"", no_action:"" };
		if ($.isPlainObject(content)) {
			$.extend(params, content);
		} else {
			if (title === true) { title = "close"; }
			if (okCallback === true) { okCallback = "close"; }
			if (noCallback === true) { noCallback = "close"; }
			if ($.isFunction(title) || title === "close" || title === false) { // title可省略
				okCallback = noCallback; noCallback = title; title = undefined;
			}
			if (okCallback == undefined) { // noCallback可省略
				okCallback = noCallback; noCallback = undefined;
			}
			$.extend(params, { content:content, title:title, yes_action:okCallback||"", no_action:noCallback||"" });
		}
		if (!params.yes_action && !params.no_action) { params.yes_action = "close"; }
		callNative("pagetips", params);
	};

