	$.each(actions, function(i, action) {
		Utils.app[action] = function(url) {
			if (!url) { url = window.top.location.href; }
			// 提取hash参数(#号后面的部分)
			var i = url.indexOf("#");
			var hash = i < 0 ? "" : url.substring(i);
			url = i < 0 ? url : url.substring(0, i);
			// 替换掉action=xxx
			url = url.replace(/action=[\-\w]+[&\?]/g, "").replace(/[&\?]action=[\-\w]+$/g, "");
			// 判断有没有问号
			var q = url.indexOf('?') < 0 ? "?" : "&";
			// 追加新的指令action=yyy
			url = Utils.getViewUrl(url) + q + "action=" + action + hash;
			window.top.location.href = url;
		};
	});
	
