	var index = 1;
	var createTopCallback = function(callback) {
		var fn = "";
		if (typeof (callback) == "string") {
			fn = callback;
		} else if ($.isFunction(callback)) {
			fn = "$NCB$" + (index++) + "$" + Randoms.number(6);
			window.top[fn] = function(json) {
				// alert("type: " + typeof(json) + "\n" + json);
				if (typeof(json) == "string" && (json.startsWith("{") || json.startsWith("["))) {
					
					json = JSON.parse(json);
				}
				callback(json);
			}
		}
		return fn;
	};
	var handleInnerFunction = function(params) {
		if ($.isPlainObject(params)) {
			for (var key in params) {
				var value = params[key];
				if ($.isPlainObject(value) || $.isArray(value)) {
					handleInnerFunction(value);
				} else if ($.isFunction(value)) {
					params[key] = createTopCallback(value);
				}
			}
		} else if ($.isArray(params)) {
			for (var i = 0; i < params.length; i++) {
				handleInnerFunction(params[i]);
			}
		}
	};
	var callNative = function(cmd, params, callback) {
		if ($.isFunction(params)) { callback = params; params = undefined; }
		// 将内部函数暴露至顶层窗口,以提供给WebView调用
		handleInnerFunction(params);
		var fn = createTopCallback(callback);
		var pt = encodeURIComponent(JSON.stringify(params || ''));
		var sn = new Date().getTime();
		var url = 'kitapps://' + cmd + '?para=' + pt + '&sn=' + sn + '&callback=' + fn;
		$.log.debug(url);
		if (Config.hybrid) {
			var iframe = window.top.document.createElement("IFRAME");
			iframe.setAttribute("src", url);
			// For some reason we need to set a non-empty size for the iOS6 simulator...
			iframe.setAttribute("height", "1px");
			iframe.setAttribute("width", "1px");
			window.top.document.documentElement.appendChild(iframe);
			iframe.parentNode.removeChild(iframe);
			iframe = null;
		} else if (cmd == "uploadFileBase64") {
			callback({
				base64: "",
				num: 2
			});
			callback({
				base64: "",
				num: 2
			});
		}
	};
